(2, 'Georgia Smith', 'georgia@getonglobe.com', 'Hi [alfikr-schools.com],\r\n\r\nI was checking your website and find out you have a good design and it looks great, but it’s not ranking on Google and other major search engines.\r\n \r\nWe can place your website on Google\'s 1st page. Yahoo, Facebook, LinkedIn, YouTube, Instagram, Pinterest etc.).\r\n \r\nLet me know if you are interested, then I can send our Packages and Pricelist.\r\n \r\nThank you,\r\nGeorgia - (Sr SEO consultant)\r\nwww.GetOnGlobe.com\r\n\r\n\r\n\r\n\r\n\r\n\r\nNote: - If you’re not Interested in our Services, please send us \"unsubscribe\"', 'Re: Quick question about website optimization', '2024-05-03', 0, '(917) 310-3348'),
(3, 'Reginald Groth', 'reginald.groth@googlemail.com', 'Dear %domain_as_name%  Members,\r\n\r\nDo you believe in the power of storytelling for alfikr-schools.com ? Picture this: a world where any text, URL, or article can seamlessly transform into captivating audiobooks or podcasts with just a few clicks. It sounds like something out of a science fiction novel, doesn\'t it? Well, allow me to introduce you to the protagonist of this tale: Ecco.\r\n\r\n=>> https://coursiify.blogspot.com/\r\n\r\nEcco isn\'t just another AI tool; it\'s a game-changer in the realm of content creation. Powered by ChatGPT4, Ecco brings your words to life in 660 different voices and 80 languages. Whether you\'re a seasoned content creator or just starting your journey, Ecco opens doors to endless possibilities.\r\n\r\n=>> https://coursiify.blogspot.com/\r\n\r\nBut here\'s the twist: Ecco isn\'t just about creating content; it\'s about turning that content into profit. With a built-in marketplace boasting 2.3 million active users, you can effortlessly share your creations with the world and receive instant payments. Imagine the potential for your brand or business!\r\n\r\nDon\'t just take my word for it. Experience the magic of Ecco for yourself with our exclusive coupon code, Ecco5OFF. Be among the first 12 to claim your discount and unlock VIP access to additional bonuses.\r\n\r\n=>> https://coursiify.blogspot.com/\r\n\r\nClick here to embark on your storytelling adventure with Ecco. Remember, every great story has a beginning - make yours with Ecco today.\r\n\r\nWarm regards,\r\n\r\n[Reginald Groth]', 'Create High-Quality Audioboks, Voiceover, Podcast WITHOUT Writing A Single Word', '2024-05-05', 0, '7816478515'),
(4, 'Search Engine Index', 'info@domainsubmit.info', 'Hello,\r\n\r\nfor your website do be displayed in searches your domain needs to be indexed in the Google Search Index.\r\n\r\nTo add your domain to Google Search Index now, please visit \r\n\r\nhttps://www.domainsubmit.info/', 'Hello,\r\n\r\nfor your website do be displayed in searches your domain needs to be indexed in the Google Search Index.\r\n\r\nTo add your domain to Google Search Index now, please visit \r\n\r\nhttps://www.domainsubmit.info/', '2024-05-07', 0, '7083503839'),
(5, 'Winston', 'redfordwinston54@gmail.com', 'Winston here from Iowa. I\'m always watching to see what newer sites are going up and I just wanted to see if you would like an extra hand with getting some targeted traffic, Create custom AI bots to answer questions from visitors on your site or walk them through a sales process, create videos/images/adcopy, remove negative listings, the list goes on.  I\'ll even shoulder 90% of the costs, dedicating my time and tools that I\'ve created myself and bought over the years.  I\'ve been doing this for over 22 years, helped thousands of people and have loved every minute of it.\r\n\r\nThere\'s virtually no cost on my end to do any of this for you except for my time starting at 99 a month. I don\'t mean to impose; I was just curious if I could lend a hand.  \r\n\r\nBrief history, I\'ve been working from home for a couple decades now and I love helping others.  I\'m married, have three girls and if I can provide for them by helping you and giving back by using the tools and knowledge I\'ve built and learned over the years, I can\'t think of a better win-win.\r\n\r\nIt amazes me that no one else is helping others quite like I do and I\'d love to show you how I can help out.  So, if you need any extra help in any way, please let me know either way as I value your time and don\'t want to pester you.\r\n\r\nPS – If I didn’t mention something you might need help with just ask, I only mentioned a handful of things to keep this brief :-)\r\n\r\n\r\nAll the best,\r\n\r\nWinston\r\nCell - 1-319-435-1790‬\r\nMy Site (w/Live Chat) - https://cutt.ly/ww91SRIU\r\n', 'We should probably talk', '2024-05-08', 0, '1-319-435-1790?'),
(6, 'Search Engine Index', 'info@domainsubmit.info', 'Hello,\r\n\r\nfor your website do be displayed in searches your domain needs to be indexed in the Google Search Index.\r\n\r\nTo add your domain to Google Search Index now, please visit \r\n\r\nhttps://www.domainsubmit.info', 'Hello,\r\n\r\nfor your website do be displayed in searches your domain needs to be indexed in the Google Search Index.\r\n\r\nTo add your domain to Google Search Index now, please visit \r\n\r\nhttps://www.domainsubmit.info', '2024-05-13', 0, '70'),
(7, 'Mani J', 'info@myseoranks.com', 'Hello team,\r\n\r\nalfikr-schools.com\r\n\r\nI was surfing through your website and realized that despite having a great design; it was not ranking on any of the search engines (Google Yahoo and Bing) for most of the keywords relating to your business.\r\n\r\nWe offer your website top 10 ranking/Best results SEO & SMO Services within very short span of time at very reasonable cost. \r\n\r\nLet me know if you are interested, I will send you our SEO Packages and price list.\r\n\r\nThanks!\r\nMani J | Sr SEO consultant\r\n\r\n\r\n\r\n If you\'re not Interested in our Services, please send us \"unsubscribe\".', 'Re: Improve your website traffic and SEO', '2024-05-13', 0, '1 347 587 8191'),
(8, 'Search Engine Index', 'info@domainsubmit.info', 'Hello,\r\n\r\nfor your website do be displayed in searches your domain needs to be indexed in the Google Search Index.\r\n\r\nTo add your domain to Google Search Index now, please visit \r\n\r\nhttps://www.domainsubmit.info/', 'Hello,\r\n\r\nfor your website do be displayed in searches your domain needs to be indexed in the Google Search Index.\r\n\r\nTo add your domain to Google Search Index now, please visit \r\n\r\nhttps://www.domainsubmit.info/', '2024-05-14', 0, '671783617'),
(9, 'Daniel Sanderson', 'planksip.dot.org@gmail.com', 'I am reaching out to explore potential collaborations where I can bring my proven track record in sales and marketing to your team. With a strong commitment to delivering measurable results, I guarantee improvements in your sales metrics.\r\n\r\nMy approach is tailored to each client, ensuring immediate gains and sustainable growth. This dedication has enabled me to build lasting relationships with all my clients, fostering trust and mutual success.\r\n\r\nI am excited to discuss how I can contribute to your goals. Please let me know a convenient time to talk.\r\n\r\nThank you for considering this opportunity. I look forward to the possibility of working together and achieving great results.\r\n\r\n\r\nDaniel Sanderson\r\nPlanksip', 'Re: Can you help me with something?', '2024-05-16', 0, '916-634-1928'),
(10, 'Greg', 'cgfsllc2@outlook.com', 'This is Gregory Stewart from Wyoming.  We\'d like to offer your business a loan to kick off the new year, to use for whatever you need.  We\'re reaching out to a few local companies and I just wanted to see if we can help at all.  Please take a look the details I put on our page here - https://cutt.ly/lwHyBuO7\r\n\r\n\r\nAll the best,\r\n\r\nGregory Stewart - Owner\r\nFast Money Locator, LLC', 'We\'d like to offer you a loan', '2024-05-16', 0, '1190363420'),
