INSERT INTO `feker_features` (`id`, `title`, `content`, `image`) VALUES
(2, 'تعليم مبكِّر', 'طريقة جديدة في التعلم، ممنهجة حسب آلية عمل الدماغ، وبمدَّة درسٍ لا تتجاوز 40 دقيقة', '1713576842h1-icon-1.png'),
(3, 'التعلُّم السريع المتقَن', 'من خلال دروس تفاعلية مباشرة بين المعلمة والطفل، وضمن مجموعات لا يزيد عدد الطلاب في المجموعة منها عن 6 أطفال ، وبمدة دوراتٍ قصيرة', '1713577678h1-icon-2.png'),
(4, 'معلمين متخصصين', 'جميع المعلمين تمَّ تدريبهم على أحدث أساليب التعليم الإلكتروني، وعلى أسلوب يبتعد عن تلقين المعرفة؛ وإنَّما يركِّز على إدارة الطالب للمعرفة', '1713577728h1-icon-3.png'),
(5, 'تعليم أونلاين', 'المناهج مصمَّمة على أيدي خبراء معنيين، بناءً على أحدث الأبحاث العلمية بما يخصُّ أنواعَ ذكاءات الطفل وأساليب تعلمه', '1713577753h1-icon-4.png'),
(6, 'بنك أسئلة', 'أسلوبٌ تعليمي لبناء شخصية الطالب الإبداعية، وتطوير مهاراتِه لتواكب متطلَّبات المستقبل السريع والمتغير باستمرار', '1713577780h1-icon-5.png'),
(7, 'قارئ ذكي', 'أسلوبٌ تعليمي لتحفيز الطالب على التعلُّم الذاتي المستمر، والتعلُّم بالاكتشاف والتجرِبة', '1713577809h1-icon-6.png'),
(8, 'التعلُّم بشغف', 'أسلوبٌ تعليمي لتحفيز الطفل على التعلُّم الذاتي المستمر، والتعلُّم بالاكتشاف والتجرِبة', '1713577844h2-icon-1.png'),
(10, 'القارئ الذكي', 'هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ', '1713577886h2-icon-3.png'),
(11, 'التعلُّم السريع', 'التعلُّم السريع', '1713579265e3.png'),
(12, 'القارئ الذكي', 'القارئ الذكي', '1713579278e2.png');
