(173, 'about_lms_1_content', 'التعليم الفعال في مدرستنا يعتمد على توجيه الجهود نحو تحسين مستوى التفاعل بين المعلم والطلاب من خلال استخدام أساليب تعليمية متنوعة تشمل التفاعل والمشاركة الفعالة للطلاب', 'التعليم الفعال في مدرستنا يعتمد على توجيه الجهود نحو تحسين مستوى التفاعل بين المعلم والطلاب من خلال استخدام أساليب تعليمية متنوعة تشمل التفاعل والمشاركة الفعالة للطلاب', 'التعليم الفعال في مدرستنا يعتمد على توجيه الجهود نحو تحسين مستوى التفاعل بين المعلم والطلاب من خلال استخدام أساليب تعليمية متنوعة تشمل التفاعل والمشاركة الفعالة للطلاب', 0),
(174, 'about_lms_2_content', 'البيئة الآمنة في مدرستنا تعني توفير مكان يشعر فيه الطلاب والمعلمون بالحماية والأمان، حيث يتم تفعيل إجراءات أمنية ووقائية لمنع الحوادث والمخاطر', 'البيئة الآمنة في مدرستنا تعني توفير مكان يشعر فيه الطلاب والمعلمون بالحماية والأمان، حيث يتم تفعيل إجراءات أمنية ووقائية لمنع الحوادث والمخاطر', 'البيئة الآمنة في مدرستنا تعني توفير مكان يشعر فيه الطلاب والمعلمون بالحماية والأمان، حيث يتم تفعيل إجراءات أمنية ووقائية لمنع الحوادث والمخاطر', 0),
(175, 'about_lms_3_content', 'المعدات في مدرستنا تشمل الأدوات والمواد التعليمية المتنوعة مثل الكتب الدراسية، والأجهزة اللوحية، والأثاث المدرسي، والأجهزة الإلكترونية، والمختبرات العلمية، وتلك المستخدمة في الرياضة والفنون', 'المعدات في مدرستنا تشمل الأدوات والمواد التعليمية المتنوعة مثل الكتب الدراسية، والأجهزة اللوحية، والأثاث المدرسي، والأجهزة الإلكترونية، والمختبرات العلمية، وتلك المستخدمة في الرياضة والفنون', 'المعدات في مدرستنا تشمل الأدوات والمواد التعليمية المتنوعة مثل الكتب الدراسية، والأجهزة اللوحية، والأثاث المدرسي، والأجهزة الإلكترونية، والمختبرات العلمية، وتلك المستخدمة في الرياضة والفنون', 0),
